  \"2016-04-07T07:52:25.784846\",\n\t\"name\": \"state-and-local-sales-tax-distributions-beginning-fiscal-year-ended-march-31-2003\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"The Department of Taxation and Finance
  administers the statewide New York State general retail sales and compensating use
  tax, as well as any general retail sales and compensating use tax imposed by a county
  or municipality in New York State. In addition, the Department administers any taxes
  imposed on consumer utilities services and other special taxes on selected commodities
  and services by municipalities and city school districts. This data set presents
  information on the yearly amount of the distribution of these taxes back to the
  appropriate taxing jurisdictions from fiscal years ended March 31, 1995.\",\n\t\"license_title\":
